import React from 'react';
import { NavLink } from 'react-router-dom';

const Navbar = ({ user, setUser }) => {
  const handleLogout = () => {
    setUser(null);
    localStorage.removeItem('user');
  };

  return (
    <nav className="bg-garshGray shadow-sm">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-4">
        <div className="flex justify-between items-center">
          {/* Logo */}
          <NavLink to="/" className="text-2xl font-bold text-garshOrange flex items-center">
            <span className="material-icons mr-2">garage</span> GARSH
          </NavLink>

          {/* Links */}
          <div className="flex space-x-4">
            {user && (
              <>
                <NavLink
                  to="/favorites"
                  className={({ isActive }) =>
                    `px-4 py-2 rounded-full ${
                      isActive ? 'bg-garshOrange text-white' : 'text-garshDark hover:bg-garshOrange hover:text-white'
                    }`
                  }
                >
                  Favoritos
                </NavLink>
                <NavLink
                  to="/user-dashboard"
                  className={({ isActive }) =>
                    `px-4 py-2 rounded-full ${
                      isActive ? 'bg-garshOrange text-white' : 'text-garshDark hover:bg-garshOrange hover:text-white'
                    }`
                  }
                >
                  Mi Dashboard
                </NavLink>
              </>
            )}
            {user?.role?.includes('host') && (
              <>
                <NavLink
                  to="/host-dashboard"
                  className={({ isActive }) =>
                    `px-4 py-2 rounded-full ${
                      isActive ? 'bg-garshOrange text-white' : 'text-garshDark hover:bg-garshOrange hover:text-white'
                    }`
                  }
                >
                  Dashboard de Anfitrión
                </NavLink>
                <NavLink
                  to="/add-space"
                  className={({ isActive }) =>
                    `px-4 py-2 rounded-full ${
                      isActive ? 'bg-garshOrange text-white' : 'text-garshDark hover:bg-garshOrange hover:text-white'
                    }`
                  }
                >
                  Agregar Espacio
                </NavLink>
              </>
            )}
            {user && (
              <NavLink
                to="/ai-planner"
                className={({ isActive }) =>
                  `px-4 py-2 rounded-full ${
                    isActive ? 'bg-garshOrange text-white' : 'text-garshDark hover:bg-garshOrange hover:text-white'
                  }`
                }
              >
                Planificador AI
              </NavLink>
            )}
            {!user ? (
              <>
                <NavLink
                  to="/login"
                  className="px-4 py-2 rounded-full text-garshDark hover:bg-garshOrange hover:text-white"
                >
                  Iniciar Sesión
                </NavLink>
                <NavLink
                  to="/register"
                  className="px-4 py-2 rounded-full bg-garshOrange text-white hover:bg-garshDark"
                >
                  Registrarse
                </NavLink>
              </>
            ) : (
              <button
                onClick={handleLogout}
                className="px-4 py-2 rounded-full bg-red-500 text-white hover:bg-red-600"
              >
                Cerrar Sesión
              </button>
            )}
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
